      //--------------- Lookup ----------------------------------------------------
      this.getLookups = function (lookupType, modelData) {
        var lookupList;
        switch (lookupType) {
          case 'MaritalStatus':
            var address = dataModelService.getAddress();
            if (address && address.State) {
              lookupList = this.getMaritalStatusLookups(address.State);
            }
            break;
          case 'ResidenceOwnershipType':
            lookupList = this.getResidenceOwnershipTypeLookups();
            break;
          case 'EmploymentStatusType':
            lookupList = this.getEmploymentStatusLookups();
            break;
          case 'YearsAt' :
            lookupList = this.getYearsAt();
            break;
          case 'EducationLevelType':
            lookupList = this.getEducationLevelLookups();
            break;
          case 'MilitaryBranch':
            lookupList = this.getMilitaryBranchLookups();
            break;
          case 'MilitaryServiceType':
            if (modelData && modelData.driver && modelData.driver.MilitaryBranch) {
              lookupList = this.getMilitaryServiceTypeLookups(modelData.driver.MilitaryBranch);
            }
            break;
          case 'Occupation':
            lookupList = this.getOccupationLookups();
            break;
          case 'StudentEnrollmentType':
            lookupList = this.getStudentEnrollmentTypeLookups();
            break;
          case 'DriversLicenseStatusType':
            lookupList = this.getLicenseStatusLookups();
            break;
          case 'NoCurrentInsuranceReasonType':
            lookupList = this.getNoCurrentInsuranceReasonLookups();
            break;
        }

        return lookupList;
      };


